Additional "id" field generated when posting into MongoDB<p>I'm learning Go and Gin framework.
I built a simple microservice connected to a MongoDB collection, everything works but when I add a document using a POST it adds the &quot;id&quot; field instead of generating the key &quot;_id&quot; field, is there a way to avoid this?</p>
<p>This is my func:</p>
<pre><code>func (r *Rest) CreatePost(c *gin.Context) {
var postCollection = database.GetCollection(r.db, &quot;GoDB&quot;)
ctx, cancel := context.WithTimeout(context.Background(), 10*time.Second)
post := new(model.Post)
defer cancel()

if err := c.ShouldBindJSON(&amp;post); err != nil {
    c.JSON(http.StatusBadRequest, gin.H{&quot;message&quot;: err})
    log.Fatal(err)
    return
}

// validation
if err := post.Validate(); err == nil {
    c.JSON(http.StatusOK, gin.H{&quot;input&quot;: &quot;valid&quot;})
} else {
    c.JSON(http.StatusBadRequest, gin.H{&quot;input validation&quot;: err.Error()})
    return
}

postPayload := model.Post{
    ID:      primitive.NewObjectID(),
    Title:   post.Title,
    Article: post.Article,
}

result, err := postCollection.InsertOne(ctx, postPayload)

if err != nil {
    c.JSON(http.StatusInternalServerError, gin.H{&quot;message&quot;: err})
    return
}

c.JSON(http.StatusOK, gin.H{&quot;message&quot;: &quot;Posted succesfully&quot;, &quot;Data&quot;: 
map[string]interface{}{&quot;data&quot;: result}})
}
</code></pre>
<p>This is my model:</p>
<pre><code>type Post struct {
ID      primitive.ObjectID
Title   string `validate:&quot;required,gte=2,lte=20&quot;`
Article string `validate:&quot;required,gte=4,lte=40&quot;`
}
</code></pre>
<p><a href="https://i.stack.imgur.com/xWZiI.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/xWZiI.png" alt="To understand this is the returned doc from Mongo" /></a></p>

