myInstance.myDelete();
myInstance.myUndelete();
</code></pre>
<p>the typescript compiler says</p>
<blockquote>
<p>error TS2339: Property 'myDelete' does not exist on type 'Document&lt;unknown, {}, { deletedAt?: Date; }&gt; &amp; Omit&lt;{ deletedAt?: Date; } &amp; { _id: ObjectId; }, never&gt;'.</p>
</blockquote>
